import React from "react";
import Profile from "../components/profile";
import { withRedux } from "../lib/redux";
import SiteLayout from "../components/siteLayout";

function profile() {
  return (
    <SiteLayout>
      <div>
        <h1>form</h1>
        <Profile />
      </div>
    </SiteLayout>
  );
}
profile.getInitialProps = ({ reduxStore }) => {
  return {};
};
export default profile;
